//dealing with some common things
import 'antd/dist/antd.css' // or 'antd/dist/antd.less'
import PropTypes from 'prop-types'

const App = ({ Component }) => {
  return <Component />
}
App.propTypes = {
  Component: PropTypes.elementType.isRequired,
}
export default App
